  `UE_status` smallint(1) DEFAULT '1' COMMENT '用户状态，0-正常，1-禁用',
  `active` smallint(1) DEFAULT '1' COMMENT '是否激活，0-未激活，1-已激活',
  `wsxx` smallint(1) DEFAULT '1' COMMENT '是否完善信息，0-未完善，1-已完善',
  `chengxin` int(1) NOT NULL DEFAULT '0' COMMENT '诚信等级，0：星星  1：钻石  2： 皇冠',
